`,n.jsxs(e.p,{children:[n.jsx(e.a,{href:"https://etcd.io/",children:"etcd"})," is a distributed key-value store designed for reliability, high availability, and consistency. It is a ",n.jsx(e.a,{href:"https://www.cncf.io/",children:"Cloud Native project"})," that powers much of the tools utilized in the Cloud Ecosystem today. It is used projects like Kubernetes, CoreOS, OpenShift, Cloud Foundry any many more. It is primarily used to store configuration, state and metadata in Cloud Systems. This article will take you through a complete guide to understanding etcd to the point of being able to integrate it into your project. We shall cover how to install it, setup a cluster, store and query etcd, operating and managing etcd and many more concepts. By the end of this blog article, you will have a solid understanding of etcd."]}),`
