`,n.jsx(e.p,{children:n.jsx(e.img,{src:"https://fulcrum.rocks/blog/wp-content/uploads/2022/04/ci-cd-pipeline-7.png",alt:""})}),`
`,n.jsx(e.p,{children:"A brief introduction on Conveyor CI. Its is a Software framework fdesigned to simplify the development of scalable and reliable CI/CD platforms by eliminating common pain points that a team ight to run into inorder to build a Scalable, reliable CI/CD Platform. It provides a simplified  streamlined, developer-friendly development paradigm for building robust custon CI/CD Tools."}),`
`,n.jsx(e.p,{children:"Recently a team that uses Conveyor CI as a dependency had an inquiry on how a CI Driver in conveyor can handle multiple instances of running CI processes without overloading the host node. This is a really important consideration I had not thought of, and for a system that runs multiple tasks in concurrency, being conscious of system resources is a really important consideration."}),`
`,n.jsxs(e.p,{children:["This got me thinking, how best can one approach such an issue. I thought of multiple solutions to this, I had considered introducing a consensus algorithm like raft, however this wasn't really an effective solution. Looking into how the Kubernetes Kube Scheduler efficiently allocates Pods to run on different nodes taking into considerations or the resource constraints of both the Pod to be allocated and the nodes its to be allocated to gave me an inspiration of having to design a custom ",n.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Scheduling_(computing)",children:"scheduling algorithm"})," that had to to take into consideration of the multiple, use case scenarios of CI/CD tools and what constraints they operate under."]}),`
`,n.jsx(e.p,{children:"I had to first come up with the high level requirements and problem statements for the CI Drivers in order to tackle this issue."}),`
`,n.jsxs(e.blockquote,{children:[`
`,n.jsxs(e.p,{children:[n.jsx(e.strong,{children:"The Problem"}),": In large production grade CI/CD Pipelines, multiple requests can initiated at the same time and due to the underlying concurrent and instant execution of CI tasks by Conveyor CI Drivers, this introduces an issue of possible node crashed or driver process termination by the Operating system due to the host node running out of system resources. Also currently, drivers don't support horizontal scalability, something that is really important for CI/CD tools that are expected to run multiple workloads at a certain point in time considering vertical scalability tends to be finite and also costs tend to increase exponentially the more you scale vertically."]}),`
`]}),`
`,n.jsx(e.p,{children:"From that problem statement I managed to identify two high level requirements."}),`
`,n.jsxs(e.ol,{children:[`
`,n.jsx(e.li,{children:"Drivers should support horizontal scaling"}),`
`,n.jsx(e.li,{children:"The Driver runtime should take into consideration available node resources before executed a task"}),`
`]}),`
`,n.jsxs(e.p,{children:["After a long night of insightful research, I came up with a bunch of solutions for this, these would assist me in designing the scheduling algorithm. I would call the ",n.jsx(e.strong,{children:"functional or technical requirements"})," if that's the right term to use."]}),`
`,n.jsx(e.p,{children:"The algorithm was to take inspiration and be a combination of multiple OS scheduling algorithms, with the help of a consensus algorithm to handle and support the distributed properties of the Driver instances."}),`
`,n.jsxs(e.p,{children:["To solve the issue of the possibility of overloading the server with tasks that require system resources than available, First i had to remove the instant execution of tasks and introduce a task queue, this would enable me to be able to incorporate a ",n.jsx(e.a,{href:"https://en.wikipedia.org/wiki/FIFO_(computing_and_electronics)",children:"FIFO-like"})," architecture as the base algorithm for scheduling tasks in a normal flow. Taking into consideration that in certain organisations, CI/CD tools are designed with the concept of having some tasks prioritized due to multiple factors, say if they would like to prioritize tasks from paying users. I also decided to incorporate a ",n.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Dynamic_priority_scheduling",children:"Priority Scheduling Algorithm"})," as the second level algorithm. Lastly, I had to introduce a ",n.jsx(e.a,{href:"https://www.sciencedirect.com/science/article/pii/S1474667017377388",children:"constraint based scheduling"})," algorithm as the last determining algorithm, these constraints can be the available system resources etc. To support such a complex algorithm, I had to introduce ",n.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Heuristic",children:"heuristics"})," that are computed by the Driver from a resource specification or defined directly in the resource specification. These heuristics can be task priority, available node resources etc."]}),`
`,n.jsx(e.p,{children:"On the issue of horizontal scalability, I decided to incorprate NATS Jetsream Consumers. This would enable distributed processing of Driver tasks laveraging the already existing powerfull features that NATS Jetstream offers out of the box."}),`
`,n.jsx(e.h2,{children:"How the Mechanism works"}),`
`,n.jsx(e.p,{children:"Alright, let's get into how it works. At the core, the tasks are organized in a priority queue, where tasks with a high priority are executed first and in instances where the priority number is equal, they are executed based on a FIFO order based on a timestamp."}),`
`,n.jsx(e.h3,{children:"Preventing resource contention"}),`
`,n.jsxs(e.p,{children:["Within the tasks Resource specification, I introduced an optional field called ",n.jsx(e.code,{children:"resourceUsage"})," that defines the expected resource usage for the task during execution. This acts as heuristic that helps the driver runtime decide whether a certain driver instance is allowed to run the task. It compares the available host node system resources and evaluates whether running that task will not cause resource contention or Out of Memory Errors. This constraint based scheduling considers any node as long as adding the task won't exit 100 percent usage of the resources, that's to say, even if a node is using up to 90% of its resources and adding the task will push it to 99% it will still schedule it on that node. it also tends to prioritize driver instances running on nodes with lower resource usage than the others, say if node A is using 60% and node B is using 55%, it's more likely to consider node B than A. But this will not always be the case, sometimes other factors might cause us to consider node A. Such a mechanism will ensure that the possibility of node failures due to resource contention is really low."]}),`
`,n.jsx(e.p,{children:"Here is some Pseudo code example to demonstrate the algorithm structure"}),`
